import './App.css';
import Dogs from './components/Dogs';
import Landing from './components/Landing';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <h1>Henry Dogs</h1>
      <BrowserRouter>
        <Switch>
          <Route exact path='/' component={Landing}></Route>
          <Route path='/dogs' element={<Dogs />}></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
